(1, -1, '', ' Front Page', 213, '1', '1', 1, '0', 1, 'frontpage', 'catalog_frontpage_headline_shop_GENERAL', 'frontpage_teaser', ' ', '<i><b><font color="#0E668C" size="16">What can I find in the shop?</font></b></i><br><br>Upgrade your clothing with Habbo Club, adopt a pet or decorate your room the way you like it. Whatever you like to do most in Habbo, you''ll find a way to make that experience even better by browsing our Shop.<br><br><li>Join <a href="event:catalog/open/habbo_club">Habbo Club</a></li><li><a href="event:catalog/open/set_pixelnew">Decorate </a>your room</li><li>Adopt a <a href="event:catalog/open/pet_horse">Pet</a>, <a href="event:catalog/open/bots">Bot</a> or <a href="event:catalog/open/monster_plant">Monsterplants</a></li><li>Make your own <a href="event:catalog/open/category_wired">Wired</a> games </li><br><i><b><font color="#0E668C" size="16">Where can I get credits?</font></b></i><br><br>Credits are given out every 15 Minutes! You can also get them by inviting other users, participating in events or gambling in our casinos!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
