(15, 234, '', 'Windows', 218, '1', '1', 1, '0', 19, 'default_3x3', 'ctlg_windows_headline1_en', 'ctlg_windows_teaser1_en', ' ', 'Let some sunshine in! Our windows come in many styles to give a unique look to your room. Who said your room can''t have a view?', ' ', '', ' ', '0', '', ''),
(16, 234, '', 'Mood Lights', 115, '1', '1', 1, '0', 10, 'default_3x3', 'catalog_dimmers_header_en', 'dimmers_teaser', ' ', 'Our range of moodlights allow you to control the atmosphere and transform your room in just a click. What will your room look like? Click the switch and find out now!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(17, 236, '', 'Christmas', 90, '1', '1', 1, '0', 2, 'default_3x3', 'catalog_xmas_headline1', 'xmas2009_catalogue', ' ', 'Get yourself into the Christmas spirit with our selection of festive furni! From baubles to Reindeer poo, we''ve got it all!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
