(19, 234, '', 'Teleports', 120, '1', '1', 1, '0', 17, 'default_3x3', 'catalog_doors_headline1', 'catalog_door_a', ' ', 'Beam yourself from one room to another with our space age teleports. Buy a pair, put one in each room and you''ve got your own suite! Teleports are sold in pairs(obviously!), so if your trade for them, check that your''re getting a linked pair.', ' ', 'Click on an item for more details.', ' ', '0', '', ''),
(20, 234, '', 'Mode', 39, '1', '1', 1, '0', 9, 'default_3x3', 'catalog_mode_headline1', 'catalog_mode_teaser1', ' ', 'Steely, grey industrial standard metal with a sleek design. The perfect range for a streetwise city dweller.', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(21, 234, '', 'Candy', 19, '1', '1', 1, '0', 4, 'default_3x3', 'catalog_candy_headline1', 'catalog_candy_teaser1', ' ', 'A bit more feminine than ''Mode'', this will add a bit of glamour and glitz to your rooms. Lacking a few items? Head on over to the ''Mode'' catagory!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(22, 234, '', 'Pura', 48, '1', '1', 1, '0', 13, 'default_3x3', 'catalog_pura_headline1', 'catalog_pura_teaser1', ' ', 'The clenest, freshest range. You can almost hear it breath cool and tranquility within your room. Use it to create a haven away from the hetic lifestyle of Habbo Hotel.', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(23, 234, '', 'Area', 14, '1', '1', 1, '0', 2, 'default_3x3', 'catalog_area_headline1', 'catalog_area_teaser1', ' ', 'A chunky and sofisticated line for the down-to-earth, studious Habbo. It''s simplicty is beautful and will add a welcoming charm to every room.', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(24, 2, '', 'Country', 21, '1', '1', 1, '0', 16, 'default_3x3', 'country_header1_en_001', 'country_teaser1', ' ', 'Lets leave the busy city streets and head over to the wide abyss of golden whear, emerald fields and home grown, organic vegetables. Everything you need to create a farm!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(25, 234, '', 'Lodge', 37, '1', '1', 1, '0', 8, 'default_3x3', 'catalog_lodge_headline1', 'catalog_lodge_teaser1', ' ', 'For that splendid ski-lodge effect with an open fire and whisky on the sidebar. This range is for those who appreicate the true beauty of solid wood.', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(26, 234, '', 'Plastic', 46, '1', '1', 1, '0', 12, 'default_3x3', 'catalog_plasto_headline1', '', ' ', 'Throw on an afro and grab a disco ball! Feel that retro, 1970s vibe? You soon will with this colourful, plastic range! Choose a colour to suit your mood and off you go!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(27, 234, '', 'Bathroom', 17, '1', '1', 1, '0', 3, 'default_3x3', 'catalog_bath_headline1', 'catalog_bath_teaser1', ' ', 'Lets face it.. you can''t live without your bathroom. Give yours guests somewhere to freshen up with our cheeful bathroom collection!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(28, 234, '', 'Plants', 220, '1', '1', 1, '0', 11, 'default_3x3', 'catalog_plants_headline1', 'catalog_plants_teaser1', ' ', 'Every room needs a plant! Not only do they bring a bit of the outside inside, they also enhance the air quality! And what better gift for a friend than a beautiful rose or elegant fruit tree...', ' ', '', ' ', '0', '', ''),
(29, 234, '', 'Rugs', 116, '1', '1', 1, '0', 15, 'default_3x3', 'catalog_rugs_headline1', 'catalog_rugs_teaser1', ' ', 'Rugs for all occasions, all non-slip and washable.', ' ', 'Click on an item for details.', ' ', '0', '', ''),
(30, 234, '', 'Gallery', 47, '1', '1', 1, '0', 5, 'default_3x3', 'catalog_gallery_headline1', 'catalog_posters_teaser1', ' ', 'Adorn your walls with posters, art, plaques and wall hangings. This gallery is bursting with items to suit all tastes, traditional and modern!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(31, 234, '', 'Trophies', 221, '1', '1', 1, '0', 18, 'trophies', 'catalog_trophies_headline1', '', ' ', 'Everyones a winner with Habbo trophies! Now you can reward all your friends with our pre-polished array of trohpies. In bronze, silver and gold. \r\nFirst choose your trophy model, then the metal and carefully type your inscription. Don''t worry, we''ll engrave it all with your name and the date.', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
